static void sf_gateway_c2_AutomatedParkingValet
  (SFc2_AutomatedParkingValetInstanceStruct *chartInstance)
{
  emlrtStack c2_st = { NULL,           /* site */
    NULL,                              /* tls */
    NULL                               /* prev */
  };

  int32_T c2_i;
  int32_T c2_i1;
  int32_T c2_loop_ub;
  int32_T c2_i2;
  int32_T c2_b_loop_ub;
  int32_T c2_i3;
  c2_st.tls = chartInstance->c2_fEmlrtCtx;
  chartInstance->c2_JITTransitionAnimation[0] = 0U;
  _sfTime_ = sf_get_time(chartInstance->S);
  for (c2_i = 0; c2_i < 3; c2_i++) {
    covrtSigUpdateFcn(chartInstance->c2_covrtInstance, 1U,
                      (*chartInstance->c2_nextGoal)[c2_i]);
  }

  for (c2_i1 = 0; c2_i1 < 3; c2_i1++) {
    covrtSigUpdateFcn(chartInstance->c2_covrtInstance, 0U,
                      (*chartInstance->c2_currentPose)[c2_i1]);
  }

  chartInstance->c2_sfEvent = CALL_EVENT;
  c2_chartstep_c2_AutomatedParkingValet(chartInstance, &c2_st);
  c2_do_animation_call_c2_AutomatedParkingValet(chartInstance);
  c2_loop_ub = (*chartInstance->c2_refPoses_sizes)[0] *
    (*chartInstance->c2_refPoses_sizes)[1] - 1;
  for (c2_i2 = 0; c2_i2 <= c2_loop_ub; c2_i2++) {
    covrtSigUpdateFcn(chartInstance->c2_covrtInstance, 3U,
                      (*chartInstance->c2_refPoses_data)[c2_i2]);
  }

  c2_b_loop_ub = (*chartInstance->c2_directions_sizes)[0] *
    (*chartInstance->c2_directions_sizes)[1] - 1;
  for (c2_i3 = 0; c2_i3 <= c2_b_loop_ub; c2_i3++) {
    covrtSigUpdateFcn(chartInstance->c2_covrtInstance, 4U,
                      (*chartInstance->c2_directions_data)[c2_i3]);
  }
}

